  //    B[5,2] = c * A[5,2] + s * A[2,2]
  //    B[5,3] = c * A[5,3] + s * A[2,3]
  //    B[5,4] = c * A[5,4] + s * A[2,4]
  //    B[5,5] = c * A[5,5] + s * A[2,5]
