  //    B[2,4] = c * A[2,4] + s * A[5,4]
  //    B[2,6] = c * A[2,6] + s * A[5,6]

  //    B[1,5] = c * A[1,5] - s * A[1,2]
  //    B[3,5] = c * A[3,5] - s * A[3,2]
