      stack[polycoeff + i] = Q;
      push(A);
      divide();
      Q = pop();
      push(stack[polycoeff + i - 1]);
      push(Q);
      push(B);
      multiply();
      subtract();
      stack[polycoeff + i - 1] = pop();
